import React from 'react';
import Navbar from './components/navbar';
import { BrowserRouter as Router, Swith, Route } from 'react-router-dom';
import './App.css';


function App() {
  return (
    <>
    <Router>
    <Navbar />
    <Swith>
      <Route path='/' exact />

    </Swith>
    </Router>


    </>
  );
}

export default App;
